import React, { useEffect, useState } from 'react'
import * as S from './styles'
import Header from '../../components/Header'
import Footer from '../../components/Footer'
import api from '../../services/api'

function teste(){
    window.location.href = "/"
}

function Home() {
    return(
        <S.Container>
        <Header />
        <a onClick={teste}>
        <h1>Home aqui</h1>
        </a>
            
        <Footer />
        </S.Container>
    )
}

export default Home
